import React, { useState, useEffect } from 'react';
import logo from './bd_logo.png';
import './App.css';
import Navigation from './Navigation/Navigation'


function App() {
  return (
    <div className="App">
      <Navigation/>
      <header className="App-header">
        <img src={logo}  />
        
        <p>Welcome to Breakdown!</p>
      </header>
    </div>
  );
}

export default App;
